package com.modules.selfgoal;import com.google.gson.annotations.SerializedName;import com.sagesurfer.constant.General;import java.io.Serializable;public class CountListModel_ implements Serializable {    @SerializedName(General.ID)    private String id;    @SerializedName(General.COUNT)    private String count;    @SerializedName(General.ON_DATE)    private String onDate;    @SerializedName(General.ON_TIME)    private String onTime;    @SerializedName(General.STATUS)    private int status;    public CountListModel_() {    }    public CountListModel_(String id, String count, String onDate, String onTime, int status) {        this.id = id;        this.count = count;        this.onDate = onDate;        this.onTime = onTime;        this.status = status;    }    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getCount() {        return count;    }    public void setCount(String count) {        this.count = count;    }    public String getOnDate() {        return onDate;    }    public void setOnDate(String onDate) {        this.onDate = onDate;    }    public String getOnTime() {        return onTime;    }    public void setOnTime(String onTime) {        this.onTime = onTime;    }    public int getStatus() {        return status;    }    public void setStatus(int status) {        this.status = status;    }}